import React from 'react';
import { Icon } from '@iconify/react';
import { Link } from 'react-router-dom';

const ChoosePaymentMethod = () => {
  return (
    <div className="w-96 h-fit z-100 bg-white shadow-lg p-2 pt-6 ">
		  <div className="flex flex-col justify-center p-4 mt-2">
			<p className='text-dark-gray font-semibold'>Choose Payment Method</p>
			<div className='w-56 font-light text-dark-gray bg-light-gray rounded mt-4 flex p-2 items-center justify-evenly'>
				<Icon icon="ion:location-outline" color="#17181A" width="20" height="20" />
				<span className='text-sm text-dark-gray'>15, Yemen Road, Yemen</span>
			</div>
			<div className='font-light text-dark-gray rounded border mt-4 flex p-2 items-center justify-start gap-2'>
			    <Icon icon="fluent:call-16-regular" color="#17181A" width="24" height="24" />				
			    <span className='text-sm text-dark-gray'>9911921432</span>
			</div>

		  </div>
		</div>
  );
};

export default ChoosePaymentMethod;
